-- ----------------------------
-- Table structure for tb_truck_info
-- ----------------------------
DROP TABLE [dbo].[tb_truck_info]
GO
CREATE TABLE [dbo].[tb_truck_info] (
[truck_Name] varchar(255) NOT NULL ,
[truck_Load] decimal(18,2) NULL ,
[per_Cost] decimal(18,2) NULL ,
[truck_Length] decimal(18,2) NULL 
)


GO
IF ((SELECT COUNT(*) from fn_listextendedproperty('MS_Description', 
'SCHEMA', N'dbo', 
'TABLE', N'tb_truck_info', 
'COLUMN', N'truck_Name')) > 0) 
EXEC sp_updateextendedproperty @name = N'MS_Description', @value = N'名称'
, @level0type = 'SCHEMA', @level0name = N'dbo'
, @level1type = 'TABLE', @level1name = N'tb_truck_info'
, @level2type = 'COLUMN', @level2name = N'truck_Name'
ELSE
